INSERT INTO `nosotros` (`id`, `mision`, `vision`, `alcance`, `valores`, `imagen_fondo`, `imagen_fondo_ancho`, `imagen_fondo_alto`, `status`) VALUES
(1, 'Desarrollo de procesos industriales y productos de la mas alta calidad para satisfacer la demanda de tiendas de autoservicio y consumidores finales.', 'Consolidar la empresa a nivel internacional como proveedor de productos de excelencia.', 'Satisfacer la demanda del consumidor final, así como a las empresas de comercio al detalle teniendo productos de la mejor calidad en todos sus enfoques.', 'Nos enfocamos  en crearla máxima calidad en nuestros  procesos y productos para asi, poder garantizar la mejor calidad en los productos que hacemos gracias a la inversión en la  tecnología de punta que  están formadas nuestras lineas, automatizando y controlando cada  uno de los procesos de producción, administración y desarrollo de proyectos-\r\n	<br><br>ETICA\r\n	<br>CALIDAD\r\n	<br>INNOVACION CONTINUA\r\n	<br>TRABAJO EN EQUIPO\r\n	<br>TEMPLANZA', 'views/nosotros/imagen_fondo/1523393408.', 0, 0, 'activo');
